import React, { Component } from 'react'



 class Listings extends Component {
   render() {
     const {apartments} = this.props
     return(
       <div>

        <h1>Listings</h1>
        <p>Check out all listings in San Diego County</p>

       </div>
    );
   }
 }

export default Listings
